import React from 'react'
import Card from './Card'
import classes from './UserList.module.css'

export default function UserList(props) {
  return (
    <Card className={classes.users}>
    <ul>
        {props.users.map(user =>
            <li key={user.id}>
                {user.name} ({user.age} years old)' '
                   {user.id}
            </li>
        )}
    </ul>
    </Card>
  )
}
